    "summary": "Salmon with roasted vegetables is a main course that serves 2. One portion of this dish contains around <b>39g of protein</b>, <b>18g of fat</b>, and a total of <b>473 calories</b>. For <b>$5.16 per serving</b>, this recipe <b>covers 46%</b> of your daily requirements of vitamins and minerals. It is brought to you by Foodista. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. Only a few people made this recipe, and 7 would say it hit the spot. It is a good option if you're following a <b>gluten free, dairy free, whole 30, and pescatarian</b> diet. A mixture of rosemary and thyme, onion, lemon juice, and a handful of other ingredients are all it takes to make this recipe so scrumptious. With a spoonacular <b>score of 95%</b>, this dish is tremendous. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/roasted-salmon-vegetables-36765\">Roasted Salmon & Vegetables</a>, <a href=\"https://spoonacular.com/recipes/salmon-with-roasted-vegetables-84853\">Salmon With Roasted Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/roasted-salmon-and-vegetables-176441\">Roasted Salmon and Vegetables</a>.",
