    "summary": "Watching your figure? This gluten free recipe has <b>525 calories</b>, <b>14g of protein</b>, and <b>36g of fat</b> per serving. For <b>82 cents per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up non-dairy cream cheese, creamy peanut butter, peanut butter cups, and a few other things to make it today. This recipe is liked by 30 foodies and cooks. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 64%</b>. This score is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/easy-no-bake-peanut-butter-pie-jars-and-a-giveaway-913761\">Easy No-Bake Peanut Butter Pie Jars, and a Giveaway</a>, <a href=\"https://spoonacular.com/recipes/dairy-free-peanut-butter-ice-cream-pie-with-chocolate-cookie-crust-918213\">Dairy-Free Peanut Butter Ice Cream Pie with Chocolate Cookie Crust</a>, and <a href=\"https://spoonacular.com/recipes/no-bake-almond-butter-pie-917199\">No Bake Almond Butter Pie</a>.",
