    "summary": "Crab Cakes Eggs Benedict takes about <b>30 minutes</b> from beginning to end. One portion of this dish contains around <b>42g of protein</b>, <b>59g of fat</b>, and a total of <b>865 calories</b>. For <b>$6.9 per serving</b>, you get a breakfast that serves 3. Several people made this recipe, and 701 would say it hit the spot. This recipe from Foodista requires onion, celery, dry bread crumbs, and english muffins. It is a good option if you're following a <b>pescatarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is great. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/benedict-crab-cakes-166711\">Benedict Crab Cakes</a>, <a href=\"https://spoonacular.com/recipes/caribbean-crab-cakes-benedict-102381\">Caribbean Crab Cakes Benedict</a>, and <a href=\"https://spoonacular.com/recipes/crab-eggs-benedict-78099\">Crab Eggs Benedict</a>.",
