    "summary": "Asparagus Eggs Benedict requires about <b>30 minutes</b> from start to finish. This recipe serves 2 and costs $2.34 per serving. One portion of this dish contains about <b>33g of protein</b>, <b>57g of fat</b>, and a total of <b>767 calories</b>. It works well as a breakfast. 146 people have tried and liked this recipe. It is brought to you by Foodista. A mixture of asparagus spears, butter, cayenne pepper, and a handful of other ingredients are all it takes to make this recipe so flavorful. With a spoonacular <b>score of 75%</b>, this dish is solid. <a href=\"https://spoonacular.com/recipes/mushroom-asparagus-eggs-benedict-406851\">Mushroom & Asparagus Eggs Benedict</a>, <a href=\"https://spoonacular.com/recipes/easy-eggs-benedict-with-asparagus-718416\">Easy Eggs Benedict with Asparagus</a>, and <a href=\"https://spoonacular.com/recipes/prosciutto-wrapped-asparagus-eggs-benedict-486583\">Prosciutto Wrapped Asparagus Eggs Benedict</a> are very similar to this recipe.",
