    "summary": "The recipe Mushroom Crepes with Vegetarian Sauce is ready <b>in roughly 45 minutes</b> and is definitely an amazing <b>lacto ovo vegetarian</b> option for lovers of Mediterranean food. For <b>$1.02 per serving</b>, you get a morn meal that serves 8. One portion of this dish contains around <b>7g of protein</b>, <b>5g of fat</b>, and a total of <b>172 calories</b>. It is brought to you by Foodista. Head to the store and pick up mushrooms, sweet paprika, ground pepper, and a few other things to make it today. 65 people have made this recipe and would make it again. Overall, this recipe earns a <b>good spoonacular score of 68%</b>. Similar recipes include <a href=\"https://spoonacular.com/recipes/mushroom-crepes-with-poblano-chile-sauce-155347\">Mushroom Crepes with Poblano Chile Sauce</a>, <a href=\"https://spoonacular.com/recipes/asparagus-crepes-with-mushroom-dill-sauce-37989\">Asparagus Crepes With Mushroom Dill Sauce</a>, and <a href=\"https://spoonacular.com/recipes/scallion-wild-rice-crepes-with-mushroom-filling-and-red-pepper-sauce-236899\">Scallion Wild Rice Crepes with Mushroom Filling and Red Pepper Sauce</a>.",
