    "instructions": "<p>Crepes:</p><ol><li>Whisk the eggs.</li><li>Add the water and mix well (you can also use a hand-held mixer).</li><li>Sprinkle the flour while continuously whisking/mixing until it has the right consistency.</li><li>Heat some oil in a frying pan over medium-high heat. Grease the whole surface of the pan and then pour the oil in a cup. You’ll be reusing it.</li><li>Pour the batter in the pan, using approximately ¼ cup for each crepe. Tilt the pan with a circular motion so that the batter coats the surface evenly.</li><li>Cook the crepe for about 2 minutes until the bottom is light brown. Loosen with a spatula, turn and cook on the other side. Repeat the process until you use up all the batter. Makes about 8 crepes.</li></ol><p>For the filling:</p><ol><li>Add the mushrooms and wine in your food processor. Blend until you get a thick paste.</li><li>Heat some 1 tbsp oil in a large saucepan.</li><li>Add the chopped onion. Sauté until golden, then add the mushroom paste and corn.</li><li>Add spices.</li><li>Cook for 15 minutes ten add the chopped dill and parsley and cook for another 5 minutes.</li><li>Let it cool for at least 10 minutes before assembling the crepes.</li><li>Fill the crepes using about 1 ½ tbsp of filling / crepe.</li></ol><p>Sauce:</p><ol><li>Mix last four ingredients and pour sauce over the vegetarian mushroom crepes.</li></ol>",
