    "summary": "Need a <b>lacto ovo vegetarian side dish</b>? Sweet Corn Pudding could be a great recipe to try. This recipe serves 10. One portion of this dish contains roughly <b>14g of protein</b>, <b>53g of fat</b>, and a total of <b>637 calories</b>. For <b>$2.14 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 24 foodies and cooks. This recipe from Foodista requires butter, cheddar cheese, flour, and eggs. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. With a spoonacular <b>score of 42%</b>, this dish is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/sweet-corn-pudding-773145\">Sweet Corn Pudding</a>, <a href=\"https://spoonacular.com/recipes/sweet-corn-pudding-300093\">Sweet Corn Pudding</a>, and <a href=\"https://spoonacular.com/recipes/sweet-corn-pudding-106734\">Sweet Corn Pudding</a>.",
