    "sourceUrl": "http://www.foodista.com/recipe/XYFWSH25/a-turkish-inspired-chicken-salad-with-tomato-cucumber-red-onion-salsa-charred-green-peppers-and-home-made-cacik-delicious-and-healthy",
    "image": "https://spoonacular.com/recipeImages/664090-556x370.jpg",
    "imageType": "jpg",
    "summary": "You can never have too many main course recipes, so give Turkish Chicken Salad with Home-made Cacik Yogurt Sauce a try. For <b>$3.77 per serving</b>, this recipe <b>covers 41%</b> of your daily requirements of vitamins and minerals. Watching your figure? This gluten free recipe has <b>713 calories</b>, <b>64g of protein</b>, and <b>40g of fat</b> per serving. Not a lot of people made this recipe, and 9 would say it hit the spot. A mixture of lemon juice, roast chicken, i head gem lettuce, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the tomatoes you could follow this main course with the <a href=\"https://spoonacular.com/recipes/pink-peony-popcorn-balls-129348\">Pink Peony Popcorn Balls</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 95%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/spicy-lamb-kabobs-with-turkish-cacik-97380\">Spicy Lamb Kabobs With Turkish Cacik</a>, <a href=\"https://spoonacular.com/recipes/jerk-rubbed-chicken-thighs-with-home-made-mango-habanero-hot-sauce-313780\">Jerk Rubbed Chicken Thighs with Home-Made Mango-Habanero Hot Sauce</a>, and <a href=\"https://spoonacular.com/recipes/yogurt-and-cucumber-dip-cacik-891875\">Yogurt and Cucumber Dip Cacik</a> for similar recipes.",
    "cuisines": [ ],
