    "summary": "Salmon Caesar Salad might be just the main course you are searching for. This gluten free, primal, fodmap friendly, and pescatarian recipe serves 2 and costs <b>$3.01 per serving</b>. One serving contains <b>393 calories</b>, <b>27g of protein</b>, and <b>29g of fat</b>. Only a few people made this recipe, and 7 would say it hit the spot. A mixture of caesar dressing, romaine, slivered almonds, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. This recipe is typical of American cuisine. All things considered, we decided this recipe <b>deserves a spoonacular score of 92%</b>. This score is excellent. Try <a href=\"https://spoonacular.com/recipes/salmon-caesar-salad-521731\">Salmon Caesar Salad</a>, <a href=\"https://spoonacular.com/recipes/salmon-caesar-salad-418441\">Salmon Caesar Salad</a>, and <a href=\"https://spoonacular.com/recipes/salmon-caesar-salad-277721\">Salmon Caesar Salad</a> for similar recipes.",
