    "summary": "Slow Cooker: Pork and Garbanzo Beans might be just the main course you are searching for. This gluten free and dairy free recipe serves 6 and costs <b>$2.83 per serving</b>. One serving contains <b>438 calories</b>, <b>58g of protein</b>, and <b>11g of fat</b>. A couple people made this recipe, and 22 would say it hit the spot. A mixture of onion, salt, garbanzo beans *1, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the onion you could follow this main course with the <a href=\"https://spoonacular.com/recipes/candy-corn-cupcakes-63881\">Candy Corn Cupcakes</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 97%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/slow-cooker-pork-and-beans-568618\">Slow Cooker Pork and Beans</a>, <a href=\"https://spoonacular.com/recipes/slow-cooker-pork-and-beans-244959\">Slow Cooker Pork and Beans</a>, and <a href=\"https://spoonacular.com/recipes/slow-cooker-pork-and-beans-619424\">Slow Cooker Pork and Beans</a> for similar recipes.",
