    "summary": "Zabaglione with Roasted Plums might be just the side dish you are searching for. One serving contains <b>220 calories</b>, <b>4g of protein</b>, and <b>5g of fat</b>. This recipe serves 4 and costs $1.17 per serving. Head to the store and pick up plums, sugar, egg yolks, and a few other things to make it today. 7 people were glad they tried this recipe. From preparation to the plate, this recipe takes roughly <b>20 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free, dairy free, and lacto ovo vegetarian</b> diet. With a spoonacular <b>score of 32%</b>, this dish is not so excellent. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/roasted-plums-698747\">Roasted Plums</a>, <a href=\"https://spoonacular.com/recipes/honey-roasted-plums-79833\">Honey-roasted Plums</a>, and <a href=\"https://spoonacular.com/recipes/sugar-roasted-plums-139647\">Sugar-Roasted Plums</a>.",
