    "summary": "Home made coffee ice cream might be just the dessert you are searching for. This recipe serves 6 and costs $1.01 per serving. One serving contains <b>490 calories</b>, <b>7g of protein</b>, and <b>37g of fat</b>. It can be enjoyed any time, but it is especially good for <b>Summer</b>. A couple people made this recipe, and 23 would say it hit the spot. If you have cream, egg yolks, milk, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 33%</b>. This score is not so spectacular. Try <a href=\"https://spoonacular.com/recipes/french-coffee-cake-prepare-home-made-coffee-cake-easily-at-home-600775\">French Coffee Cake- prepare home made coffee cake easily at home</a>, <a href=\"https://spoonacular.com/recipes/home-made-ice-cream-600938\">Home Made Ice Cream</a>, and <a href=\"https://spoonacular.com/recipes/home-made-irish-cream-553413\">Home made Irish cream</a> for similar recipes.",
