    "instructions": "<ol><li>Combine the cream, milk, sugar, and coffee in a medium, heavy saucepan</li><li>Bring to a gentle boil over medium heat; remove from the heat and set aside.</li><li>Beat the egg yolks in a medium bowl.</li><li>Whisk 1 cup of the hot cream into the egg yolks.</li><li>Add the vanilla extract.</li><li>Gradually add the egg mixture in a slow, steady stream, to the hot cream</li><li>Cook over low heat, stirring constantly until slightly thickened, about 4-5 minutes.</li><li>Remove from the heat and strain through a fine mesh strainer into a clean container.</li><li>Cover with plastic wrap, pressing down against the surface to keep a skin from forming.</li><li>Chill in the refrigerator for at least 2 hours.</li><li>Pour the mixture into an ice cream machine and churn until frozen (according to the manufacturer's instructions).</li><li>Transfer to plastic container and place in the freezer for a few hours before serving.</li><li>Serving: take it out of the freezer for 5-10 minutes before serving, or longer, so it comes to the right scooping temperature.</li><li>Easy suggestion: ice cream is best served in chilled glass or porcelain bowls. Scoop it with a hot, but dry, ice-cream spoon (soak it in boiling water, then wipe dry).</li></ol>",
