    "summary": "Need a <b>vegetarian dessert</b>? Creamy Lime Pie Square Bites could be an outstanding recipe to try. This recipe makes 2 servings with <b>631 calories</b>, <b>8g of protein</b>, and <b>33g of fat</b> each. For <b>92 cents per serving</b>, this recipe <b>covers 10%</b> of your daily requirements of vitamins and minerals. A mixture of sugar, graham cracker crumbs, lime zest, and a handful of other ingredients are all it takes to make this recipe so delicious. Plenty of people made this recipe, and 1669 would say it hit the spot. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 44%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/creamy-lime-and-coconut-truffle-bites-53822\">Creamy Lime And Coconut Truffle Bites</a>, <a href=\"https://spoonacular.com/recipes/macadamia-key-lime-pie-911117\">Macadamia Key Lime Pie</a>, and <a href=\"https://spoonacular.com/recipes/key-lime-bites-371690\">Key Lime Bites</a> for similar recipes.",
