    "summary": "Pumpkin gnocchi with basil and Parmesan is a Mediterranean recipe that serves 6. One portion of this dish contains about <b>13g of protein</b>, <b>7g of fat</b>, and a total of <b>409 calories</b>. For <b>73 cents per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista requires corn flour, eggs, sea salt, and basil leaves. 20 people have tried and liked this recipe. It works best as a main course, and is done in approximately <b>about 45 minutes</b>. With a spoonacular <b>score of 83%</b>, this dish is excellent. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/toasted-gnocchi-with-mushrooms-basil-and-parmesan-799555\">Toasted Gnocchi with Mushrooms, Basil and Parmesan</a>, <a href=\"https://spoonacular.com/recipes/creamy-parmesan-gnocchi-with-mozzarella-tomatoes-and-basil-492398\">Creamy Parmesan Gnocchi with Mozzarella, Tomatoes and Basil</a>, and <a href=\"https://spoonacular.com/recipes/basil-gnocchi-298157\">Basil Gnocchi</a>.",
