    "summary": "Watching your figure? This vegetarian recipe has <b>358 calories</b>, <b>4g of protein</b>, and <b>19g of fat</b> per serving. For <b>$1.1 per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 34 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Head to the store and pick up cream cheese, pecans, butter, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 26%</b>. This score is not so great. Try <a href=\"https://spoonacular.com/recipes/autumn-apple-cheesecake-760758\">Autumn Apple Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/caramel-apple-butter-cheesecake-dip-for-sundaysupper-autumn-apple-party-554054\">Caramel Apple Butter Cheesecake Dip for #SundaySupper Autumn Apple Party</a>, and <a href=\"https://spoonacular.com/recipes/california-pizza-kitchen-pumpkin-cheesecake-this-is-a-perfect-cheesecake-for-the-fall-holidays-their-cheesecake-isnt-a-secret-anymore-600275\">California Pizza Kitchen Pumpkin Cheesecake – this is a perfect cheesecake for the fall holidays, their cheesecake isn’t a secret anymore</a> for similar recipes.",
