    "instructions": "<ol><li>FOR THE APPLE LAYER:</li><li>Peel and core the apples and slice thinly add to the sugar and cinnamon and mix well until all the apples are coated.  Set aside.</li><li>FOR THE CRUST:</li><li>Preheat oven to 350</li><li>In a small sauce pan melt the butter</li><li>In the food processor add the pecans and chop until very fine, add the Graham crackers and pulse until finely chopped and put mixture into a bowl.  Add the butter and with a fork stir to combine, until all the cracker is wet with butter and no dry parts are still visible.</li><li>Place the mixture into the bottom of a 9 inch springform pan and press down to form a solid bottom crust.  Place into the center of the oven and bake for about 10 minutes, remove to a wire rack to cool..</li><li>FOR THE BATTER:</li><li>In the bowl of the mixer place the softened cream cheese and the sugar and on medium speed cream until well  combined, scrape down the sides of the bowl and the blades of the mixer add the vanilla and on medium low add the eggs one at a time and continue to beat until each is well incorporated.  Pour into the cooled springform pan and smooth the mixture level.</li><li>APPLES:</li><li>Arrange the apples in decorative layer over the batter and then place the pan into the oven and bake for about 70 minutes.</li><li>Remove to a wire rack to cool.</li><li>In the mean time melt the preserve and once the apples a lightly cooled brush the preserve over apples to coat all and give a nice sheen to the top.  Sprinkle the pecans over the apples.  Now carefully run a knife around the edges of the cake to loosen from the sides of the pan and then cover and refrigerate for at least 5 hours, overnight even better.</li><li>Remove from the refrigerator about an hour before serving and remove the sides of the springform  pan.</li></ol>",
