    "summary": "The recipe Baby Chick Cupcakes is ready <b>in around around 45 minutes</b> and is definitely a great <b>lacto ovo vegetarian</b> option for lovers of American food. For <b>43 cents per serving</b>, you get a dessert that serves 12. One portion of this dish contains roughly <b>4g of protein</b>, <b>22g of fat</b>, and a total of <b>454 calories</b>. This recipe is liked by 7 foodies and cooks. A mixture of food colouring, brown and orange m&ms, coconut, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by Foodista. With a spoonacular <b>score of 17%</b>, this dish is not so super. Similar recipes are <a href=\"https://spoonacular.com/recipes/baby-chick-cupcakes-371054\">Baby Chick Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/mama-and-baby-chick-cupcakes-163839\">Maman and Baby Chick Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/baby-chick-cake-274567\">Baby Chick Cake</a>.",
