    "summary": "Crock Pot Chicken Pot Pie requires around <b>roughly 45 minutes</b> from start to finish. One portion of this dish contains around <b>14g of protein</b>, <b>11g of fat</b>, and a total of <b>255 calories</b>. For <b>95 cents per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. This recipe serves 20. 15 people have tried and liked this recipe. It works well as an inexpensive main course. It is a good option if you're following a <b>dairy free</b> diet. This recipe from Foodista requires chicken breasts, condensed cream of chicken soup, pie crusts, and vegetables - we prefer peas and carrots. With a spoonacular <b>score of 58%</b>, this dish is solid. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/crock-pot-chicken-pot-pie-527700\">Crock Pot Chicken Pot Pie</a>, <a href=\"https://spoonacular.com/recipes/chicken-crock-pot-pie-491435\">Chicken (Crock) Pot Pie</a>, and <a href=\"https://spoonacular.com/recipes/crock-pot-freezer-packs-one-pot-chicken-dinner-609383\">Crock Pot Freezer Packs: One Pot Chicken Dinner</a>.",
