    "summary": "The recipe Braised Smoky Pork With Fresh Pappardelle can be made <b>in about approximately 45 minutes</b>. For <b>$6.36 per serving</b>, this recipe <b>covers 57%</b> of your daily requirements of vitamins and minerals. One serving contains <b>1217 calories</b>, <b>99g of protein</b>, and <b>34g of fat</b>. This recipe serves 4. 7 people have made this recipe and would make it again. Head to the store and pick up pork shoulder, sea salt - applewood works very, canolan oil, and a few other things to make it today. It is brought to you by Foodista. Overall, this recipe earns a <b>tremendous spoonacular score of 90%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/braised-rabbit-pappardelle-224009\">Braised rabbit pappardelle</a>, <a href=\"https://spoonacular.com/recipes/milk-braised-pork-shoulder-ragu-with-fresh-fettuccine-169401\">Milk-Braised Pork Shoulder Ragu with Fresh Fettuccine</a>, and <a href=\"https://spoonacular.com/recipes/braised-beef-stroganoff-with-pappardelle-76357\">Braised Beef Stroganoff With Pappardelle</a>.",
    "cuisines": [ ],
    "dishTypes": [ ],
