    "summary": "The recipe Apple Walnut Brownies could satisfy your American craving in about <b>1 hour and 15 minutes</b>. For <b>$1.19 per serving</b>, you get a dessert that serves 10. One serving contains <b>401 calories</b>, <b>6g of protein</b>, and <b>33g of fat</b>. This recipe from Foodista has 10 fans. A mixture of self rising flour, semi-sweet chocolate, butter, and a handful of other ingredients are all it takes to make this recipe so scrumptious. All things considered, we decided this recipe <b>deserves a spoonacular score of 39%</b>. This score is not so spectacular. Similar recipes include <a href=\"https://spoonacular.com/recipes/walnut-brownies-454785\">Walnut Brownies</a>, <a href=\"https://spoonacular.com/recipes/walnut-oat-brownies-416333\">Walnut Oat Brownies</a>, and <a href=\"https://spoonacular.com/recipes/walnut-brownies-408642\">Walnut Brownies</a>.",
