    "summary": "Easy Chicken Cordon Bleu takes about <b>around 45 minutes</b> from beginning to end. One serving contains <b>131 calories</b>, <b>6g of protein</b>, and <b>7g of fat</b>. This recipe serves 8 and costs 24 cents per serving. 22 people were impressed by this recipe. This recipe from Foodista requires bread crumbs- add, ham, egg, and salt. With a spoonacular <b>score of 19%</b>, this dish is not so excellent. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/easy-chicken-cordon-bleu-401928\">Easy Chicken Cordon Bleu</a>, <a href=\"https://spoonacular.com/recipes/easy-chicken-cordon-bleu-74367\">Easy Chicken Cordon Bleu</a>, and <a href=\"https://spoonacular.com/recipes/easy-chicken-cordon-bleu-627364\">Easy Chicken Cordon Bleu</a>.",
