    "summary": "For <b>$5.96 per serving</b>, this recipe <b>covers 45%</b> of your daily requirements of vitamins and minerals. One serving contains <b>1260 calories</b>, <b>32g of protein</b>, and <b>73g of fat</b>. 6 people have made this recipe and would make it again. If you have peas, thyme leaves, an of salt and pepper, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 85%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/beef-bourguignon-buf-bourguignon-buf-la-bourguignonne-beef-burgundy-521886\">Beef bourguignon (bœuf bourguignon / bœuf à la bourguignonne / beef Burgundy)</a>, <a href=\"https://spoonacular.com/recipes/minced-beef-pie-minty-mushy-peas-225675\">Minced beef pie & minty mushy peas</a>, and <a href=\"https://spoonacular.com/recipes/beef-bourguignon-81293\">Beef Bourguignon</a> for similar recipes.",
