    "summary": "Chinese Potstickers requires around <b>approximately 45 minutes</b> from start to finish. This hor d'oeuvre has <b>73 calories</b>, <b>2g of protein</b>, and <b>5g of fat</b> per serving. This recipe serves 24 and costs 19 cents per serving. It is a good option if you're following a <b>dairy free</b> diet. A few people really liked this Chinese dish. 37 people were glad they tried this recipe. If you have vegetable oil, scallions, ground pepper, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. With a spoonacular <b>score of 18%</b>, this dish is not so tremendous. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/chinese-potstickers-534151\">Chinese Potstickers</a>, <a href=\"https://spoonacular.com/recipes/chinese-potstickers-92059\">Chinese Potstickers</a>, and <a href=\"https://spoonacular.com/recipes/chinese-vegan-potstickers-610529\">Chinese Vegan PotStickers</a>.",
