    "instructions": "<ol><li>Fill a bowl with water, add the gelatin and let is soak. Pour milk into a pan & bring to just below simmering, then remove the pan from the heat. Do NOT let it boil. Drain & squeeze out the gelatin & add it to the milk. Pour the cream into another pan, add the sugar and vanilla bean and bring to a boil over low heat, stirring constantly. Then remove the pan from the heat, remove the vanilla bean and stir in the milk mixture.</li><li>You can put the mixture into any kind of ramekin, mold, cup, you like. Rinse your 'glass' in ice-cold water, shaking out any excess water & fill with the milk mixture. Chill in the refrigerator for several hours until set (at least 3-4 hours). Turn out onto a serving dish & serve with fruit sauce or chocolate sauce.</li><li>In a double boiler melt chocolate bar. Once the chocolate is completely melted, slowly whisk in cream until the desired consistancy is reached.</li><li>Drizzle over the top of the panna cotta once on the serving plate.</li></ol>",
