    "summary": "You can never have too many main course recipes, so give Bacon-Wrapped Meatloaf a try. One portion of this dish contains about <b>35g of protein</b>, <b>55g of fat</b>, and a total of <b>709 calories</b>. This gluten free and primal recipe serves 6 and costs <b>$2.24 per serving</b>. This recipe from Foodista requires ground pork, mustard, dry mustard, and water. 30 people have made this recipe and would make it again. From preparation to the plate, this recipe takes about <b>1 hour and 30 minutes</b>. With a spoonacular <b>score of 66%</b>, this dish is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/bacon-wrapped-meatloaf-579009\">Bacon Wrapped Meatloaf</a>, <a href=\"https://spoonacular.com/recipes/bacon-wrapped-meatloaf-476068\">Bacon Wrapped Meatloaf</a>, and <a href=\"https://spoonacular.com/recipes/bacon-wrapped-meatloaf-808830\">Bacon Wrapped Meatloaf</a>.",
