    "instructions": "<ol><li>Preheat the oven to 350 F.</li><li>Melt the butter in a small skillet over medium-low heat; cook the onion until soft but not brown, about 5 minutes.  Add the garlic and cook for another minute.  Remove from heat and set aside.</li><li>Place a rack on or in a large, glass baking dish.  Alternating slightly, lay the strips of bacon across the rack, one end in the middle and allowing the other end to hang over the side of the dish.  Set aside.</li><li>In a small bowl, mix 3 tablespoons of the tomato paste with the water, apple cider vinegar, honey, prepared mustard and 1/2 teaspoon of salt.  Set aside.</li><li>In a large mixing bowl, combine the remaining ingredients with the onion/garlic mixture and the remaining tomato paste and gently but thoroughly mix with your hands.  Form into a loaf directly on top of the bacon, leaving enough of the bacon uncovered to wrap the top of the meatloaf.  Spoon the glaze over the top of the meatloaf and spread down the sides, covering it completely.  Lift the ends of the bacon hanging down the sides and place over the top of the meatloaf.</li><li>Bake for an hour, or until the meatloaf is cooked through and the bacon is brown and crisp.  Allow to rest for 10 minutes before serving.</li></ol>",
