    "summary": "The recipe German Rhubarb Cake with Meringue could satisfy your European craving in around <b>around 45 minutes</b>. For <b>61 cents per serving</b>, you get a dessert that serves 12. One portion of this dish contains approximately <b>5g of protein</b>, <b>4g of fat</b>, and a total of <b>212 calories</b>. 15 people were glad they tried this recipe. A mixture of rhubarb, sugar, eggs, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by Foodista. It will be a hit at your <b>Mother's Day</b> event. It is a good option if you're following a <b>dairy free and lacto ovo vegetarian</b> diet. With a spoonacular <b>score of 33%</b>, this dish is rather bad. Try <a href=\"https://spoonacular.com/recipes/rhubarb-meringue-cake-381275\">Rhubarb Meringue Cake</a>, <a href=\"https://spoonacular.com/recipes/rhubarb-meringue-pie-134891\">Rhubarb Meringue Pie</a>, and <a href=\"https://spoonacular.com/recipes/rhubarb-meringue-pie-387893\">Rhubarb Meringue Pie</a> for similar recipes.",
