    "imageType": "jpg",
    "summary": "Savory Olive & Goat Cheese Palmiers might be just the hor d'oeuvre you are searching for. For <b>77 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. This recipe makes 16 servings with <b>202 calories</b>, <b>4g of protein</b>, and <b>15g of fat</b> each. 7 people have made this recipe and would make it again. Head to the store and pick up coarse salt, puff pastry dough, olive tapenade, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 34%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/savory-cheese-palmiers-756417\">Savory Cheese Palmiers</a>, <a href=\"https://spoonacular.com/recipes/red-pepper-walnut-goats-cheese-palmiers-215468\">Red pepper, walnut & goat’s cheese palmiers</a>, and <a href=\"https://spoonacular.com/recipes/goat-cheese-mustard-and-rosemary-palmiers-step-by-step-542302\">Goat Cheese, Mustard and Rosemary Palmiers {step-by-step}</a> for similar recipes.",
