    "imageType": "jpg",
    "summary": "Triple Chocolate Pumpkin Pie requires about <b>about 45 minutes</b> from start to finish. This recipe serves 12 and costs $1.24 per serving. One serving contains <b>417 calories</b>, <b>7g of protein</b>, and <b>23g of fat</b>. It is perfect for <b>Thanksgiving</b>. 9 people were impressed by this recipe. It is brought to you by Foodista. If you have semisweet chocolate, vanillan extract, light-brown sugar, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 34%</b>. This score is not so outstanding. Try <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-494520\">Triple-Chocolate Pumpkin Pie</a>, <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-24660\">Triple-chocolate Pumpkin Pie</a>, and <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-247792\">Triple Chocolate Pumpkin Pie</a> for similar recipes.",
