    "summary": "The recipe Healthy Vegan Red Velvet Brownies could satisfy your American craving in roughly <b>45 minutes</b>. Watching your figure? This gluten free and vegan recipe has <b>182 calories</b>, <b>5g of protein</b>, and <b>5g of fat</b> per serving. For <b>42 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 91 would say it hit the spot. It is perfect for <b>valentin day</b>. A mixture of cocoa powder, apple sauce, brown sugar, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/healthy-red-velvet-quinoa-brownies-735043\">Healthy Red Velvet Quinoa Brownies</a>, <a href=\"https://spoonacular.com/recipes/red-velvet-cake-roll-912616\">Red Velvet Cake Roll</a>, and <a href=\"https://spoonacular.com/recipes/healthy-vegan-chocolate-coconut-brownies-730405\">Healthy Vegan Chocolate Coconut Brownies</a> for similar recipes.",
