    "summary": "Cornmeal-Crusted Catfish with Cajun Seasoning and Spicy Tartar Sauce is a main course that serves 4. One portion of this dish contains roughly <b>27g of protein</b>, <b>26g of fat</b>, and a total of <b>420 calories</b>. For <b>$2.87 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. Not a lot of people made this recipe, and 8 would say it hit the spot. This recipe is typical of Cajun cuisine. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. If you have granulated garlic, dill pickle juice, scallion, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free and pescatarian</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 71%</b>, which is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/spicy-catfish-tenders-with-cajun-tartar-sauce-86027\">Spicy Catfish Tenders With Cajun Tartar Sauce</a>, <a href=\"https://spoonacular.com/recipes/spicy-cornmeal-crusted-catfish-86038\">Spicy Cornmeal-crusted Catfish</a>, and <a href=\"https://spoonacular.com/recipes/spicy-cornmeal-crusted-catfish-86033\">Spicy Cornmeal-Crusted Catfish</a>.",
