    "imageType": "jpg",
    "summary": "Coffee-braised Short Ribs might be just the main course you are searching for. For <b>$5.55 per serving</b>, this recipe <b>covers 32%</b> of your daily requirements of vitamins and minerals. This recipe makes 5 servings with <b>1390 calories</b>, <b>49g of protein</b>, and <b>126g of fat</b> each. 6 people have tried and liked this recipe. If you have tomato paste, cilantro, brown sugar, and a few other ingredients on hand, you can make it. To use up the strong coffee you could follow this main course with the <a href=\"https://spoonacular.com/recipes/coffee-coffee-cake-537443\">Coffee Coffee Cake</a> as a dessert. It is a good option if you're following a <b>gluten free and dairy free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 88%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/coffee-braised-short-ribs-386092\">Coffee-Braised Short Ribs</a>, <a href=\"https://spoonacular.com/recipes/coffee-braised-short-ribs-492600\">Coffee-Braised Short Ribs</a>, and <a href=\"https://spoonacular.com/recipes/michaels-coffee-braised-short-ribs-329926\">Michael's Coffee Braised Short Ribs</a> for similar recipes.",
