    "occasions": [ ],
    "instructions": "<ol><li>Preheat oven to 350F (180 C).  Bake pecans in a single layer in a shallow pan for about 7-8 minutes or until lightly toasted and fragrant, stirring halfway through.Remove from oven, let cool down, and chop.  Reserve.</li><li>Reduce oven temperature to 325F (about 160 C). Grease and flour a 9-inch (22.5 cm) springform pan. Sprinkle pecans over bottom of the prepared pan and reserve.</li><li>In a heavy-duty electric stand mixer, beat cream cheese, granulated sugar, and vanilla at medium speed until well-blended and smooth.  Add 3 eggs (1 at a time), beating after  each addition until just blended.  Reserve.</li><li>In a separate large bowl, whisk together brown sugar, melted butter, and remaining egg until blended.  Then stir in the flour, cinnamon, baking powder, and salt.  Add the peeled and diced apples to the mixture and stir gently.  Spoon batter into prepared pan.  Carefully spoon cream cheese mixture over batter.</li><li>Bake at 325F ( about 160 C) for 70 minutes or until set.  Remove from oven, and gently run a knife around outer edge of cheesecake to loosen from sides of pan but do NOT remove sides of pan.  Cool completely in pan on a wire rack  for about 2 hours.  Remove side of the pan and transfer to a serving plate.</li><li>Meanwhile, prepare Caramel Apple Topping and Caramel Sauce.  Spoon topping over cheesecake; drizzle with 1/2 cup Caramel Sauce.  Reserve 1 cup Caramel Sauce to drizzle over the cheesecake later if you have not served the whole dessert at once.</li><li>For the Caramel Apple Topping: In a large skillet over medium heat, melt the butter; then, add both the sugar and lemon juice.  Cook, stirring constantly with a long-handled wooden spoon, for 5 to 6 minutes or until mixture turns a light golden brown.  Add the apple wedges and cook, stirring often, for 15 to 18 additional minutes or until apples are tender and caramelized.  Remove from heat and let cool for 20 minutes.</li><li>Meanwhile, prepare Caramel Apple Topping and Caramel Sauce.  Spoon topping over cheesecake; drizzle with 1/2 cup Caramel Sauce.  Reserve 1 cup Caramel Sauce to drizzle over the cheesecake later if you have not served the whole dessert at once.</li><li>For the Caramel Sauce: In a medium saucepan over medium-high heat, bring the brown sugar, butter, whipping cream, and honey to a boil, stirring constantly; then, boil  stirring constantly for 2 minutes.  Remove from heat, stir in the vanilla, and cool 15 minutes before serving.</li></ol>",
